INSERT INTO `maritalissues` (`id`, `description`, `title`, `article`, `created_by`, `date`) VALUES
(3, 'Couples argue over many things but money is by far one of the most frequent and serious. ', 'Money Issue', 'Couples argue over many things but money is by far one of the most frequent and serious. The solution is to discuss issues openly and consult within the family.\r\n\r\nFor instance, the issue of a wife working outside the home ca', 'Dr Dada Abdulrasheed', '2019-02-22 08:41:27'),
(4, 'In-laws are the focus of blame and reproach when there are marital disputes. But there are ways to maintain a good relationship with them.', ' In-laws', 'Here are some tips:\r\n\r\nRemember your spouse\'s parents have known them longer and loved them longer. Never make an issue about \"me or them\".\r\nLet respective parties settle their own disputes. If your mother-in-law has a proble', 'Dr Dada Abdulrasheed', '2019-02-22 08:43:53'),
(5, 'The tug of war that results from differing understandings of parenting', 'Parenting', 'The tug of war that results from differing understandings of parenting are also a source of tension in marriage. One solution is to start learning about Islamic parenting before having children. If you already have kids, you ', 'Dr Dada Abdulrasheed', '2019-02-22 08:44:58'),
(6, 'Stress is an almost constant factor in most people\'s lives', 'Stress ', 'Stress is an almost constant factor in most people\'s lives in North America. Muslim couples are no exception. Stress from work, for example, is carried into the home.\r\n\r\nCouples and families need to work out a coping mechanis', 'Dr Dada Abdulrasheed', '2019-02-22 08:46:00'),
(7, 'This is an extremely sad reality and unless it is dealt with promptly by victims', 'Domestic violence', 'This is an extremely sad reality and unless it is dealt with promptly by victims, perpetrators and/or those concerned about the two, then the family will break. Seeking help is necessary and if domestic violence is not stoppe', 'Dr Dada Abdulrasheed', '2019-02-22 08:47:38'),
(8, 'This is a growing problem around the world', ' Spiritual incompatibility', 'This is a growing problem around the world, where Muslims from all around the world live and different understandings of Islam are present. There is a disturbing lack of tolerance amongst young Muslims, especially, who may ge', 'Dr Dada Abdulrasheed', '2019-02-22 08:50:38'),
(9, 'This is one of the least talked about problems', 'Sexual dysfunction', 'This is one of the least talked about problems, but it is one that is wreaking havoc in a number of marriages. Many couples who are marrying are not learning the Islamic perspective on sex and marriage. As a result, when they', 'Dr Dada Abdulrasheed', '2019-02-22 08:53:05'),
(10, 'Islam forbids marriage between Muslim women and non-Muslim men.', 'Interfaith marriages', 'Islam forbids marriage between Muslim women and non-Muslim men. There are a number of Muslim women who have taken this step and regretted it later. Such an action, in most Muslim families, results in the woman being isolated ', 'Dr Dada Abdulrasheed', '2019-02-22 08:54:17'),
(11, 'While Islam does not forbid intercultural marriages', 'Intercultural marriages', 'While Islam does not forbid intercultural marriages, they can become a source of tension when Muslims, primarily the couple, but also their families, make their culture more important than Islam. If parental support is there ', 'Dr Dada Abdulrasheed', '2019-02-22 08:55:19'),
(12, 'While girls are being encouraged to become scientists', 'Lack of domestic skills', 'While girls are being encouraged to become scientists, engineers and doctors, for instance, there is little to no emphasis being placed on gaining domestic skills. It should be remembered that in Islam, while women are not fo', 'Dr Dada Abdulrasheed', '2019-02-22 09:00:21'),
(13, 'While young Muslim women of the West are being encouraged to be strong and confident', 'The modern Muslim woman meets the old-fashioned Muslim man', 'While young Muslim women of the West are being encouraged to be strong and confident, boys are being raised in the same way and with the same cultural expectations as their fathers. As a result, young couples face a tug of wa', 'Dr Dada Abdulrasheed', '2019-02-22 09:03:03'),
(14, 'The most basic and essential attribute of a Muslim marriage is the common faith that binds the couple.', 'Faith', 'Since Islam is a way of life and not just a religion confined to weekly worship it becomes an integral part of a Muslim\'s life. The frame of reference shared by the couple eases communication and sharing of values which is no', 'Dr Dada Abdulrasheed', '2019-02-22 09:06:10'),
(15, 'When the Prophet Muhammad asked his Companions do you wish that Allah should forgive you\' they said, of course O Prophet of Allah. He responded, then forgive each other\'.', 'Forgiving', 'One of the main components of a happy marriage is that the spouses are able to forgive, that they do not hold grudges or act judgmental towards each other. It is expected that when we live with someone, situations may arise w', 'Dr Dada Abdulrasheed', '2019-02-22 09:07:34'),
(16, ' When we constantly remind our spouses of all the times they let us down or hurt us we have not truly forgiven. ', 'Forget', 'When we constantly remind our spouses of all the times they let us down or hurt us we have not truly forgiven. Things that happened in the past must be left there and not be used as fresh ammunition in new situations. Couples', 'Dr Dada Abdulrasheed', '2019-02-22 09:08:42'),
(17, 'Sabr (patience) is the most useful tool to have in managing a healthy lifestyle.', 'Forbearance', 'Sabr (patience) is the most useful tool to have in managing a healthy lifestyle. Being patient and forbearing puts us in a proactive frame of mind it brings us closer to Allah through Tawakul and reliance .We develop an inner', 'Dr Dada Abdulrasheed', '2019-02-22 09:09:34'),
(18, 'Many couples unnecessarily make themselves miserable because they are unwilling to bend a little.', 'Flexible', 'We should not expect our spouses to be our extensions. They are their own selves with personalities, likes and dislikes. We must respect their right to be them selves as long as it does not compromise their Deen (religion). B', 'Dr Dada Abdulrasheed', '2019-02-22 09:10:33'),
(19, 'This aspect of marriage has three components.', 'Friendship', 'First is to develop a friendship with our spouses.The relationship based on friendship is more able to withstand outside pressures.\r\n\r\nWe honor, trust, respect, accept and care for our friends, in spite of our differences. Th', 'Dr Dada Abdulrasheed', '2019-02-22 09:11:42'),
(20, 'Couples that do not laugh together have to work on sharing some fun times.', 'Fun', 'Couples that do not laugh together have to work on sharing some fun times. The Prophet was known to play with his wives. A simple walk in the park can add much spark to the relationship. Taking up a sport together or watching', 'Dr Dada Abdulrasheed', '2019-02-22 09:12:36'),
(21, 'It is commanded by Allah that we be faithful to our spouses', 'Faithful', 'It is commanded by Allah that we be faithful to our spouses. Adultery is a capital crime in Islam that is punishable by death. However there are various forms of unfaithful behavior prevalent among some Muslims.', 'Dr Dada Abdulrasheed', '2019-02-22 09:13:25');

